]

    "title": "",
    "width": 300,
    "height": 300,
    "layer": [
        {

                "x": {
                    "field": "step",

                    "mark": "line"

                {
                    "mark": "rule",

    ]
}

                        "as": "xy_count"

                ],
                "groupby": [
                    "predicted",
                    "actual"
                ]
            },
            {
                "impute": "xy_count",
                "groupby": [
                    "rev",
                    "predicted"
                ],
                "key": "actual",

            },
            {

                    "actual"
                ],

                "groupby": []

            {

                "as": "percent_of_max"
